//function mouse_over(imagenum)
function mouse_over(imagenum)
{
  if (has_loaded==1)
  {  
    var inum;
    var i;
    var name;
    var iname;
    name = "status"+imagenum;
    window.status = _eval(name);

    if (do__javascript == 0)
    {
      return true;
    } //if (do__javascript == 0)

    inum = parseint(imagenum);

    for (i = 4; i <12; i=i+1)
    {
      name="image" +i;

      if (i== inum)
      {
        iname="overimage" +i+".src";
      }
      else
      {
        iname="outimage" +i+".src";
      } //if (i== inum)

      document[name].src=_eval(iname);
    } //for (i = 5; i <12; i=i+1)
  } //if (has_loaded==1)
  return true; 
} //function mouse_over(imagenum)

//function mouse_out(imagenum)
function mouse_out(imagenum)
{
  if (has_loaded==1)
  {
    var name;
    var iname;
    window.status = " ";

    if (do__javascript == 0)
    {
      return true;
    } //if (do__javascript == 0)

    name = "image"+imagenum;
    iname = "outimage"+imagenum+".src";
    document [name].src = _eval(iname);
  } //if (has_loaded==1)

  return true;
} //function mouse_out(imagenum)

//function di20(id, newsrc)
//swaps images.
function di20(id, newsrc)
{
    var theimage = fwfindimage(document, id, 0);
    if (theimage)
    {
        theimage.src = newsrc;
    } //if (theimage)
} //function di20(id, newsrc)

//function fwfindimage(doc, name, j)
//track and set toggle group button states.
function fwfindimage(doc, name, j) 
{
    var theimage = false;
    if (doc.images)
    {
        theimage = doc.images[name];
    } //if (doc.images)

    if (theimage)
    {
        return theimage;
    } //if (theimage)

    if (doc.layers)
    {
        for (j = 0; j < doc.layers.length; j++)
        {
            theimage = fwfindimage(doc.layers[j].document, name, 0);

            if (theimage)
            {
                return (theimage);
            } //if (theimage)
        } //for (j = 0; j < doc.layers.length; j++)
    } //if (doc.layers)

    return (false);
} //function fwfindimage(doc, name, j)
// -->


<!-- hide this script from non-_javascript-enabled browsers
function mm_findobj(n, d) { //v3.0
  var p,i,x;  if(!d) d=document; if((p=n.indexof("?"))>0&&parent.frames.length) {
    d=parent.frames[n.substring(p+1)].document; n=n.substring(0,p);}
  if(!(x=d[n])&&d.all) x=d.all[n]; for (i=0;!x&&i<d.forms.length;i++) x=d.forms[i][n];
  for(i=0;!x&&d.layers&&i<d.layers.length;i++) x=mm_findobj(n,d.layers[i].document); return x;
}

/* functions that swaps images. */
function mm_swapimage() { //v3.0
  var i,j=0,x,a=mm_swapimage.arguments; document.mm_sr=new array; for(i=0;i<(a.length-2);i+=3)
   if ((x=mm_findobj(a[i]))!=null){document.mm_sr[j++]=x; if(!x.osrc) x.osrc=x.src; x.src=a[i+2];}
}
function mm_swapimgrestore() { //v3.0
  var i,x,a=document.mm_sr; for(i=0;a&&i<a.length&&(x=a[i])&&x.osrc;i++) x.src=x.osrc;
}

// stop hiding -->


